import YouTubeEmbed from '../../components/youtube-embed/YouTubeEmbed';
import './PopYoutubePageStyles.scss';

const PopYTpage = (props) => {
	console.log(typeof props);
	var videoId = JSON.stringify(props); 
	console.log(typeof videoId);
	console.log(videoId);

	return(
		<div>
			<PopSearchHeader />
			<div className='youtube_container'>
				<YouTubeEmbed videoId='4t7J90Ca1uU' />
			</div>
		</div>
	);
}




